This PR makes the following changes:
- Move `runtime/disco/ccl` to `runtime/disco/nccl` as RCCL itself uses
  NCCL as a prefix to its APIs;
- Consolidate `utils.h` to `nccl.cc` to avoid potential misuse of the
  private header file;
- Reduce the number of macros used in `nccl.cc`.

* [Runtime] ShapeTuple.Product and ShapeTuple Printing (#15652)

This PR adds two convenient methods for `ShapeTuple`.

```C++
// Returns the number of elements in the shape,
// i.e. the product of all dimensions
ShapeTupleObj::index_type ShapeTupleObj::Product();

// Printing method for shape
std::ostream& operator<<(std::ostream& os, const ShapeTuple& shape);
```

* [Disco] Add `Scatter-From-Worker0`

This PR introduces an API:

```C++
void ScatterFromWorker0(Optional<NDArray> send, NDArray recv);
```

This mimics the MPI-style scattering primitive that divides NDArray
`send` into chunks, and send them to each worker's NDArray `recv`.

This PR refactors the NDArrayCache support with the following changes:

- Support loading metadata from a string rather than a concrete JSON
  file on disc;
- Remove dependency to std::filesystem as it is not well supported in
  certain platforms yet. Details:
  https://github.com/apache/tvm/pull/15654#issuecomment-1703282818.
- Simplify format used in `shard-info.json` as detailed below:

```
// Existing format
[
  {
    "name": "x0",
    "shard_dim": 0,
  },
  {
    "name": "x1",
    "shard_dim": 1,
  }
]

// New format
{
  "x0": 0,
  "x1": 1,
}
```

